syntax = "proto3";

package Proto;


message AvatarFetterLevelRewardRsp {
	enum AvatarFetterLevelRewardRsp_CmdId {
		option allow_alias = true;
		None = 0;
		CmdId = 1612;
		EnetChannelId = 0;
		EnetIsReliable = 1;
	}

	uint32 RewardId = 15;
	int32 Retcode = 14;
	uint32 FetterLevel = 2;
	uint64 AvatarGuid = 6;
}
